import { ApsService } from './ApsService';
import { ResiliencyConfiguration } from './ResiliencyConfiguration';
export class ApsClient {
    constructor(resiliencyConfig, logger) {
        this.resiliencyConfig = new ResiliencyConfiguration();
        this.resiliencyConfig = resiliencyConfig;
        this._apsService = new ApsService(this.resiliencyConfig);
        this.logger = logger;
        this.logger.logDebug(`Initializing resiliency config:  ${this.resiliencyConfig}`);
    }
    get apsService() {
        return this._apsService;
    }
}
